import React from 'react'
import styled from "styled-components";
function Chat() {
    return (
        <ChatContainer>
            <h1>chat</h1>
            <Header>
                <HeaderLeft>
                    <h4><strong>#room name</strong></h4>
                    <StartBorderOutlineIcon/>
                </HeaderLeft>
                <HeaderRight>
                    <p>
                        <InfoOutlinedIcon/>
                        Details
                    </p>
                </HeaderRight>
            </Header>
            <h1>chat</h1>
            <h1>chat</h1><h1>chat</h1>
        </ChatContainer>
    )
}

export default Chat
const Header=styled.div`
display:flex;
justify-content:space-space-between
`;
const HeaderLeft=styled.div``;
const HeaderRgiht=styled.div``;
const ChatContainer=styled.div`
    margin-top:50px;
    flex-direction:0.7;
    flex-grow:1;

    overflow-y:scroll;
   
    
    `;
